import React from 'react';
import Block1 from './block1';
import Block2 from './block2';
import Block3 from './block3';
import Block4 from './block4';

export default class Page extends React.Component{


    render(){
const restyle ={
    align: "block",
    width: "50px",
    position: "relative",
    padding: "auto",
    height: "65px",
    width: "65px"
}

      return(
          <div>
        <Block1 style={restyle}/>
        <Block2 style={restyle}/>
        <Block3 style={restyle}/>
        <Block4 style={restyle}/>
          </div>
      );


    }


}
